"use strict";const mapUtils = require(".");const assert = require("assert");test();function test() {    testCalculatePixelArea();    testLatLngToTile();    testTileToLatLng();}function testCalculatePixelArea() {    console.log("Test case: mapUtils.calculatePixelArea");    assert.strictEqual(mapUtils.calculatePixelArea({lat: 0, zoom: 0}), 156543);    assert.strictEqual(mapUtils.calculatePixelArea({lat: 39, zoom: 6}), 1901);    console.log("OK.")}function testLatLngToTile() {    console.log("Test case: mapUtils.latLngToTile #1");    const tile1 = mapUtils.latLngToTile({latLng: {lat: 0, lng: 0}, zoom: 0});    assert.strictEqual(tile1.x, 0);    assert.strictEqual(tile1.y, 0);    assert.strictEqual(tile1.zoom, 0);    console.log("OK.");    console.log("Test case: mapUtils.latLngToTile #2");    const tile2 = mapUtils.latLngToTile({latLng: {lat: 35.4606699514953, lng: 40.78125}, zoom: 7});    assert.strictEqual(tile2.x, 78);    assert.strictEqual(tile2.y, 50);    assert.strictEqual(tile2.zoom, 7);    console.log("OK.");}function testTileToLatLng() {    console.log("Test case: mapUtils.tileToLatLng #1");    const latLng1 = mapUtils.tileToLatLng({x: 0, y: 0, zoom: 0});    assert.deepEqual(latLng1, {lat: 0, lng: 0, zoom: 0});    console.log("OK.");    console.log("Test case: mapUtils.tileToLatLng #2");    const latLng2 = mapUtils.tileToLatLng({x: 78, y: 50, zoom: 7});    assert.deepEqual(latLng2, {lat: 35.4606699514953, lng: 40.78125, zoom: 7});    console.log("OK.");}